import Icon from '@chakra-ui/icon'
import { HStack,Text } from '@chakra-ui/layout'
import React from 'react'
import { FaFacebookF, FaGoogle, FaSpotify, FaShopify } from 'react-icons/fa'
import { FaSun, FaMoon, FaInstagram, FaGithub, FaLinkedin ,FaBars, FaDownload, FaYoutube} from 'react-icons/fa'
import { useMediaQuery } from '@chakra-ui/media-query';
import { VStack } from '@chakra-ui/react';

function Social() {
    const [isNotSmallerScreen] = useMediaQuery("(min-width:600px)");
    return (

        <VStack>
            <Text className="textedit" fontWeight="bold" fontSize="3xl">Connect With Me</Text>
        <HStack spacing={isNotSmallerScreen?"24":"10"} py = {10}>
            <Icon as={FaGithub} boxSize="30" />
            <Icon as={FaLinkedin} boxSize="30" />
            <Icon as={FaInstagram} boxSize="30" />
            <Icon as={FaYoutube} boxSize="30" />
        </HStack>
        </VStack>
    )
}

export default Social
